import { Box, Center, Flex, Spacer, Text, useColorModeValue } from "@chakra-ui/react";
import { ColorModeSwitcher } from "./ColorModeSwitcher";

const Header = (): JSX.Element => {
  const fontColor = useColorModeValue("mode.header.light", "mode.header.dark");

  return (
    <Center>
      <Flex align="center" padding={5} w="100%">
        <Box>
          <Text fontSize="5xl" as="b" color={fontColor}>
            AMK SPEECH-TO-TEXT
          </Text>
        </Box>
        <Spacer />
        <ColorModeSwitcher />
      </Flex>
    </Center>
  );
};

export default Header;
